import React, { Component } from 'react'
import About from './About'
import Contact from './Contact'
import Portfolio from './Portfolio'
import Resume from './Resume'

export default class Home extends Component {
  render () {
    return (
      <div>
        <About/>
        <Contact />
        <Portfolio />
        <Resume />
      </div>
    )
  }
}
